import React, { Component } from 'react';
import 'list.css' ;
import PropTypes from 'prop-types';


class List extends Component{
    constructor(props){
        super(props);
        this.message = "hello from note component"
    }

    render(props){
        return(
            <div>
                <h1>{this.message}</h1>
            </div>
        )
    }
}


export default List;
